首周りまでしっかりとガード！フードウォーマー！<br>
ゲレンデや普段使いなどの防寒対策やファッションのポイントとして<br>
<br>
裏地はソフトウール<br>
裏地は暖かい生地で寒い日でも快適に外出できます。<br>
触り心地もよく快適に過ごせます。<br>
<br>
調節可能なボタン<br>
自分にフィットするようにボタンで調整ができます。<br>
<br>
水洗い可能！<br>
汚れたら手洗いで洗濯することが可能です。<br>
※洗濯機は使用しないでください。<br>
<br>
材質：ポリエステル<br>
サイズ：フリーサイズ (男女兼用)<br>
カラー：ライトグレー、グレー、ブラック<br>
重量(約)：137g<br>
製造国：中国<br>
<br>
※こちらの商品はメール便発送にて送料無料です。<br>
※ゆうメールでの発送は（ポスト投函）代金引換、日付指定はできませんのでご了承ください。<br>
