★登山、アウトドアに！ノースフェイスのホライズンハット！<br>
<br>
●つば裏のプリント柄が個性的なホライズンハット。<br>
●首筋まではカバーできないキャップ型と違い、全方向からの紫外線を遮り視界を確保します。<br>
●UVガード機能を備えたことで、より安心感が高まりました。<br>
●頭囲にぐるりと配置したベンチレーションのおかげで通気性もクリア。<br>
●あごストラップ付きで風に飛ばされる心配もありません。<br>
●UVケア（UPF15～30）対応、軽量性にも優れた素材を使用！サイズ調整機能つきです！<br>
<br>
■素材<br>
本体：ナイロン100％<br>
ツバ裏、メッシュ部：ポリエステル100％<br>
■企画製造販売元　株式会社ゴールドウイン<br>
