★ノースフェイスのあったかワークキャップ！<br>
<br>
●冬仕様で両サイドにボア裏地の耳当て付き。頭部の裏地にも起毛素材を使用。<br>
●スナップボタンが付いているので、気候に合わせて耳当て無しでの着用も可能です。<br>
●後部にサイズ調節用のスナップボタン付き。<br>
●つば部分にワイヤー入り。お好みの形状でご使用いただけます。<br>
●シンプルなデザインなので、ウィンタースポーツ・タウンユース等様々なシーンで大活躍！<br>
<br>
■素材<br>
表地：ナイロン100％(コーティング等樹脂加工)<br>
裏地：ポリエステル100％<br>
■企画製造販売元　株式会社ゴールドウイン<br>
