★ナイキのキャップ！<br>
<br>
●フロントに立体的なスウッシュロゴ刺繍を配置したシンプルなキャップ。<br>
●サイドとバックパネルにレーザー加工を施し、通気性を考慮。<br>
●機能的なコンフォートビルと男女兼用デザインが魅力。<br>
●スポーツシーンはもちろん、タウンユースとしてデイリー使いにもオススメです。<br>
<br>
