日本野鳥の会 アウトドアグローブ<br>
<br>
掌部に独自の加工を施した天然ゴム（波型ゴム加工）を圧着してあります。<br>
物を持つとゴムが倒れて接触面が大きくなり、ぴったりグリップする仕組みで、抜群のすべり止め効果を発揮します。<br>
<br>
●グリップ力が抜群で、野外での薪割りなど力仕事にお奨めです。<br>
DIY作業、草むしり等にも最適です。<br>
<br>
●装着したままで図鑑のページをめくることができ、双眼鏡などの操作も楽で手の汚れを気にせず野外観察が楽しめます。<br>
<br>
※サイズによって口ゴム（手を入れる部分の縁）の色が異なります。<br>
※撮影状況によって、写真の色と実物の若干の違いがあります。<br>
※迷彩柄とピンク柄は、複数の色の糸を織り込んで模様を作っているため、ひとつずつ模様が異なります。<br>
